import React from "react";
import ProjectCard from "Components/Card/index";

interface Props {
	cards: Array<{
		id: string;
		category: string;
		title: string;
		src: string;
		content: string;
		tags: Array<string>;
	}>;
}

const ProjectsPresenter: React.VFC = ({workingCards}: Props) => {
	return (
		<div className="container container--card">
			<div className="content-wrap">
				<ProjectCard />
			</div>
		</div>
	);
};

export default ProjectsPresenter;
